//import Box2 from './Box2';
import React, { useState, useEffect } from 'react';
import '../index.css';

const mice = [];


function Simulation(props){

    useEffect(() => {
        for(let i = 0; i < props.n; i++){
            mice[i] = {id: i};
        }
    }, []);

    const miceItems = mice.map(mouse => 
        <li key={mouse.id}>
          <p>Mouse</p>
          <img src='../images/img1.png'/>
        </li>
      )

    return (
       <>{miceItems}
       </>
    );
}

export default Simulation;
